95 minuten

goed

met David Andrews, Deena Aziz en LeVar Burton

Claire en Matt Thompson zijn gehuwde wetenschappers die worden bezocht door een welgestelde vrouw die een geheime organisatie 
financiert, genaamd The Jensen Project. Het stel heeft al eerder voor die organisatie gewerkt, maar nam ontslag nadat Claire 
vernederd werd wegens een mislukt experiment. De groep leidt nu een geavanceerd ondergronds onderzoek om de meest moeilijke 
problemen in de wereld op te lossen. Ingrid vraagt hen om terug te komen om te helpen om potentieel gevaarlijke technologie 
niet in de verkeerde handen te laten vallen. Ze nemen het aanbod aan en worden vergezeld door hun enigszins opstandige zoon 
Brody, die echter wel een echte high-tech expert is.
